import React from "react";

const Contact = (props) => {
  return (
    <div className="d-flex align-items-center p-3 my-2 bg-light rounded">
      <div className="flex-shrink-0">
        <img
          src={`https://ui-avatars.com/api/?name=${props.contact.name}`}
          className="rounded-circle"
          alt=""
          style={{ width: "50px", height: "50px" }}
        />
      </div>
      <div className="flex-grow-1 ms-3">
        <h5 className="mb-1">{props.contact.name}</h5>
        <p className="mb-1 text-muted">{props.contact.email}</p>
        <p className="mb-0 text-muted">{props.contact.phone}</p>
      </div>
      <div className="ms-auto">
        <button
          className={`btn btn-sm ${props.contact.isFavorite ? "btn-warning" : "btn-outline-warning"} me-2`}
          onClick={() => props.favoriteClick(props.contact)}
        >
          <i className="bi bi-star"></i>
        </button>
        <button className="btn btn-sm btn-primary me-2">
          <i className="bi bi-pencil-square"></i>
        </button>
        <button className="btn btn-sm btn-danger">
          <i className="bi bi-trash-fill"></i>
        </button>
      </div>
    </div>
  );
};

export default Contact;
